import React from 'react'

const Flash = ({message, classname}) => {
  return (
    <div className={'flash '+ classname}>
        <div className="message">
            {message}
        </div>
        <i onClick={(event)=>{
            event.target.parentElement.remove();
        }}>X</i>
    </div>
  )
}

export default Flash
